import React, { Component } from 'react';

class Users extends Component {
    constructor(props){
        super(props)

        this.state = {
            users: [],
            show: this.props.show,
        }
    }

    render(){
        return (
            <h1> Users </h1>
        )
    }

}

export default Users;
